import React from "react";

const Navbar = () => {

    return (
        <div>
            <li className="order">
                <li>About</li>
                <li>Projects</li>
                <li>Skills</li>
                <li>Contacts</li>
            </li>

        </div>

    )
};

export default Navbar;
